import { Route, Navigate } from 'react-router-dom';

function PrivateRoute({ isAuthenticated, ...props }) {
  return isAuthenticated ? (
    <Route {...props} />
  ) : (
    <Navigate to="/login" replace />
  );
}

export default PrivateRoute;
